import React from 'react';
import { animated, useSpring } from '@react-spring/web';

interface BirdProps {
  position: number;
  velocity: number;
}

const Bird: React.FC<BirdProps> = ({ position, velocity }) => {
  const spring = useSpring({
    from: { transform: 'translateY(0px) rotate(0deg)' },
    to: { 
      transform: `translateY(${position}px) rotate(${Math.min(Math.max(velocity * 5, -30), 90)}deg)`
    },
    config: { tension: 300 }
  });

  return (
    <>
      <animated.div
        style={{
          ...spring,
          width: '40px',
          height: '40px',
          backgroundColor: 'yellow',
          borderRadius: '50%',
          position: 'absolute',
          left: '50px',
          zIndex: 2
        }}
      />
      <div
        style={{
          position: 'absolute',
          left: '80px',
          top: `${position + 20}px`,
          width: 0,
          height: 0,
          borderTop: '10px solid transparent',
          borderBottom: '10px solid transparent',
          borderLeft: '15px solid orange',
          transform: `rotate(${Math.min(Math.max(velocity * 5, -30), 90)}deg)`,
          zIndex: 2
        }}
      />
    </>
  );
};

export default Bird;
